import React from 'react';
import logo from '../logo.png';
import { AppBar, Button, Toolbar, Typography, Stack } from '@mui/material';

const NavBar = () => {
    return (
        <React.Fragment>
            <AppBar position='static' sx={{ top: 0, left: 0, right: 0, position: 'fixed', width: '100%' }}>
                <Toolbar /*sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}*/ >
                    <Stack direction='row' spacing={2}>
                        <Button color='inherit' href='/'>Home</Button>
                        <Button color='inherit' href='/QuemSomos'>Quem Somos</Button>
                        <Button color='inherit' href='/ContratacaoPlanos'>Planos</Button>
                        <Button color='inherit' href='/Contato'>Contato</Button>
                    </Stack>
                </Toolbar>
                <img src={logo} alt="logo" className='logoImg'></img>

            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
